import React from "react"
import Images from "../images/Images"

const WorksDetails = props => {
  const { projectLink, projectImg } = props
  return (
    <a
      href={projectLink}
      class="portfolio__item"
      target="_blank"
      rel="noreferrer">
      <img src={projectImg} alt="" className="portfolio__img" />
      {/* <img src={`Image.${projectImg}`} alt="" className="portfolio__img" /> */}
    </a>
  )
}
export default WorksDetails
